export function setTimesheet(excel=''){const rows=excel.split('\n');const inputs=document.getElementsByClassName('ipad-time-field field-value-nopad field-right-aligned');let k=0;for(let row of rows){const cells=row.split('\t');for(let cell of cells){inputs[k].value=cell;k++}}}
export function getRowNames(){return Array.from(new Set(Array.prototype.slice.call(document.getElementsByClassName('h_border_middleRow_last ellipsisCell tab-list-data-L')).map(e=>e.title))).concat(Array.from(new Set(Array.prototype.slice.call(document.getElementsByClassName('h_border_corner_bottom_right ellipsisCell tab-list-data-L')).map(e=>e.title))))}
